    <div class=""col-7 small-screen-100"">
        <p class=""text-dark"">Topics is an app for having discourse about worldwide events. This site uses inputted data which will be listed on this page. Please use this to understand what data will be collected by this site and how it will be used.</p>
        
        <br><h6 id=""data-collected"" class=""font-weight-bold text-muted"">Data collected by this site</h6>
        <p>When registering an account for this app, any credentials used for the registration process are used for authentication purposes. Any images or messages uploaded to the site will be displayed publicly in any discussions that one is involved in. Passwords are able to be changed through the profile.</p>

